import React, { useState, useEffect } from "react";
import parse from "csv-parse/lib/sync";
import csvData from "./bestPitches_ex.csv";

const Results = () => {
  const [playerData, setPlayerData] = useState([]);
  const [searchTerm, setSearchTerm] = useState("");

  useEffect(() => {
    const parsedData = parse(csvData, { columns: true });
    setPlayerData(parsedData);
  }, []);

  return (
    <div>
      <input
        type="text"
        value={searchTerm}
        onChange={(e) => setSearchTerm(e.target.value)}
      />
      <table>
        <thead>
          <tr>
            <th>Player Name</th>
            <th>Pitch Type</th>
            <th>Stuff Grade</th>
            <th>Release Speed</th>
            <th>InducedVertBreak</th>
          </tr>
        </thead>
        <tbody>
          {playerData
            .filter((data) =>
              data.player_name.toLowerCase().includes(searchTerm.toLowerCase())
            )
            .map((data, index) => (
              <tr key={index}>
                <td>{data.player_name}</td>
                <td>{data.pitch_type}</td>
                <td>{data.stuffGrade}</td>
                <td>{data.release_speed}</td>
                <td>{data.InducedVertBreak}</td>
              </tr>
            ))}
        </tbody>
      </table>
    </div>
  );
};

export default Results;
